import React from 'react';


function Header() {
    return (
      <div >
        <h1>URL Shortener</h1>

          <aside align='right'>
            <a href="/">Home </a>
            <a href="/user/login"> Login </a>
            <a href="/user/signup"> Signup </a>
          </aside>

      </div>

    );
  }

  export default Header;
